import {} from "react";
import { Image, StatusBar, StyleSheet, Text, TextInput, View } from "react-native";
import { RootStackScreenProps } from "../../types";

export default function Register({ navigation }: RootStackScreenProps<"Register">) {
  return (
    <View style={styles.container}>
      <Image source={require('../../assets/images/icon.png')} style={styles.logo}/>
      <Text style={styles.title}>Se registe com seu numero</Text>
      <View style={styles.numberContainer}>
        <TextInput placeholder="Seu numero" style={styles.input}/>
      </View>
    </View>
  )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    marginTop: StatusBar.currentHeight,
    alignItems: 'center',
  },
  logo: {
    width: 150,
    height: 150,
    marginTop: 20,
  },
  title: {
    fontSize: 12,
    fontWeight: 'bold',
  },
  numberContainer: {
    borderWidth: 1,
    borderColor: '#222',
    borderRadius: 10,
    width: '70%',
    height: 40,
    marginTop: 5,
  },
  input: {
    width: '100%',
    height: '100%',
    borderLeftWidth: 1,
    borderLeftColor: '#222',
  }
});
